import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Button, Alert, Breadcrumb, Card, Image } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import NavBar from './navbar';

import honoluluImage from './images/honolulu.jpeg';

function App() {
  return (
    <div className="Body">

      <NavBar/>
      <img src={honoluluImage} alt="Honolulu" style={{ width: '100%', height: 'auto' }} />
      <header className="App-header">
        <Card >
          <Card.Img />
          <Card.Body>
            <Card.Title>
              Card Example
            </Card.Title>
            <Card.Text>
              This is an example of react boostrap cards.
            </Card.Text>
            <Button variant="seconary">Read More</Button>
          </Card.Body>

        </Card>
        <Breadcrumb>
          <Breadcrumb.Item>Test1</Breadcrumb.Item>
          <Breadcrumb.Item>Test2</Breadcrumb.Item>
          <Breadcrumb.Item active>Test3</Breadcrumb.Item>
        </Breadcrumb>
        <Alert variant="primary">This is a button</Alert>
        <Button>  Test Button</Button>

      </header>
    </div>
  );
}

export default App;
